import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './login/login.component';  // Ensure this import is correct

const routes: Routes = [
  { path: 'login', component: LoginComponent },  // Define the route
  { path: '', redirectTo: '/login', pathMatch: 'full' }, // Optional: Redirect the root path to login
  // Add other routes here if needed
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
